import React, { Component } from 'react';
import { connect } from 'react-redux';

class EnginePick extends Component {

  state = {
    main_unit_assemblies: []
  }

  componentDidMount() {
    console.log("mounted")
    fetch(`http://localhost:3000/models/${this.props.modelId}/assemblies`)
    .then(resp => resp.json())
    .then(json => {
      main_unit_assemblies = json.filter( assembly => assembly.assembly_type === "main_unit")
    })
  
  }

  render() {
    return (
      <div>
        Pick Engine
      </div>
    );
  }
}

const mapStateToProps = state => (
  {modelId: state.modelId}
)

const mapDispatchToProps = dispatch => (
  {}
)



export default connect(mapStateToProps, mapDispatchToProps)(EnginePick)
